const b = document.getElementById("body-content")
const c = document.getElementById("copyright")
const d = document.getElementById("Blk")
const e = document.getElementById("R")
function loaded(){
    e.innerHTML=""
}
const printAttempt = localStorage.getItem('printAttempt');
if(printAttempt=='True'){
    b.style.color=" #cc0000"
    
    setTimeout(()=>{},60000);
    window.location.replace("./blocked.html")
    

}else{
window.onbeforeprint=()=>{

b.style.display="None"
alert("printing is disallowed")
localStorage.setItem('printAttempt','True')


}
window.onafterprint=()=>{b.style.display="None"
                       
c.style.display="block"
setTimeout(()=>{},60000);
window.location.replace("./blocked.html")
}
}